      "snippet": {
        "publishedAt": "2023-01-08T22:20:04Z",
        "channelId": "UCTapFcyNk2zzc7LnPUjNNQA",
        "title": "⚽️ ATLÉTICO DE MADRID vs FC BARCELONA | EN DIRECTO #LaLiga Jornada 16",
        "description": "Dieciséis derrotas ha sufrido el #AtléticodeMadrid de Diego Simeone en sus 32 duelos contra el #FCBarcelona, alertado y presionado en su visita de este domingo al Metropolitano, donde cayó en sus dos últimas visitas, lo aguarda Antoine Griezmann -el futbolista diferencial rojiblanco- y pone a prueba el liderato sin su goleador, Robert Lewandowski, ni Jordi Alba. \n\n Insustancial en el Barcelona, que prescindió de él hace dos veranos, con 34 goles en 102 partidos, 'El Principito', protagonista de 147 tantos en 316 partidos como atlético, es el hombre más incontestable del actual equipo madrileño, transformado en un jugador total, por su fútbol, por su sacrificio, por su visión, por su lectura y por su determinación, con la que amenaza este domingo el orden de la clasificación de #LaLiga. \n\n También es la esperanza del Atlético. Por las cualidades del ' + Char(39) + '8' + Char(39) + ' pasa todo lo que pueda pensar en términos positivos este curso, como la obligación que tiene de defender sin descuido su lugar entre los cuatro primeros o la misión hoy aparentemente imposible de reengancharse a la competencia por el título, a once puntos de la cima del Barcelona. \n\n Es la última ocasión para creer en ello. También es una encrucijada para el Barcelona, entre la duda de su empate de la última jornada ante el Espanyol y entre la inquietud de la victoria por 3-4 contra el Intercity en la Copa del Rey, pero también entre la seguridad que describen sus números: líder las últimas cuatro citas, con 12 triunfos en las últimas 14 jornadas, con tan solo 6 goles en contra en 15 encuentros, con 34 goles a favor... \n\n Y sin Jordi Alba ni Robert Lewandowski. El delantero polaco vio esta semana cómo el Tribunal de Administrativo del Deporte (TAD) confirmaba los tres partidos de sanción que el Comité de Competición le puso tras la desconsideración que interpretó el árbitro Jesús Gil Manzano después de expulsarle ante el Osasuna. Así, Xavi tendrá que idear 